import React, { Component } from 'react';

class PersonalInjuryPage extends Component {
    render() {
        return (
            <div className='personal-injury-page'>
                <h1>An Attorney Who Will Fight For The Settlement You Deserve</h1>
                <p>From soft tissue to catastrophic injury including wrongful death, John Williams has over three decades of experience presenting and pursuing claims on behalf of his clients. Automobile accident, motorcycle accident, premises liability (slip and fall), dog bite, medical malpractice, uninsured/under insured claims, John Williams has demonstrated success in these arenas. For a no obligation, free consultation of your potential personal injury/wrongful death case call John Williams.</p>
            </div>
        );
    }
}

export default PersonalInjuryPage;
